import request from "@/utils/request";
export function islogin(user_id, user_password) {
     return request({
        methods : 'POST',
        url : 'login/',
         headers: {
             'Content-Type': 'application/octet-stream',
             'Access-Control-Allow-Origin':"*",
         },
        data:{
            user_id:user_id,
            user_password:user_password
        },
    })

}
